import React from 'react';
import AssestCard from '../AssetCard';
import Mint from '../Mint';
import MintedNFTs from '../NFTlist';

 

function Home() {
  return (
    <div>
    <div>
      <AssestCard />
    </div>
  
    <div>
      <Mint />
    </div>

    <div>
      <MintedNFTs />
    </div>

  </div>
  );
}

export default Home;
